  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Development of the Medicaid Analytic
  Extract Enrollee Master (MAXEM) Data, 2005 to 2007</p>n<p>MAXEM is a data set that
  removes duplicate enrollee records both within and across years and within and across
  states.</p>n<p>Two reports have been completed and released since it has been developed.
  \ The first report describes the design and development of the MAXEM data for 2005
  and 2006.  And the second report describes the design and development of the MAXEM
  data for 2005-2007.</p>n\",\n\t\"owner_org\": \"3609164c-4c49-4a44-9179-23163027dc0a\",\n\t\"extras\":
